import React, { Component } from "react";
import "./TNode.css";

export default class TNode extends Component {
    // state = {
    //     row,
    //     col,
    //     isStart,
    //     isFinish,
    //     isVisited
    // };
  constructor(row, col, isStart, isFinish) {
    super();
    this.setState = {
      row: row,
      col: col,
      isStart: isStart,
      isFinish: isFinish,
      isVisited: false,
    };
  }

  render() {
      return <div className="TNode">
          <code>${this.row}</code>
    </div>;
  }
}
